@RiddlerA: thanks a lot for all the uploads. With the internet speeds that majority of people have in India, it's just awesome to download High Res prints that you provide.
I have downloaded many of them..but in some I feel quality a lagging a bit, I know it's the best with the file size you provide..I want to suggest that instead of 720p do 480p, I have watched some 480p stuff and the difference will not be much as quality will cover it....
Or increase the file size of 720p by 200-300 MB. Please consider..thanks again.
